    [],nt"revision_timestamp": "2016-07-27T23:03:05.802029",nt"name": "aerial-survey-of-pacific-walrus-1980",nt"isopen":
    false,nt"url": null,nt"notes": "The second coordinated U.S.-U.S.S.R. aerial
    survey of walruses was completed in September 1980. The first was undertaken in
    September- October 1975. In 1980, surveys undertaken by the U.S. side were done
    on 10 to 20 September. The results of this survey indicate that there were an estimated
    140,000 plus walruses east of 173u00b0 W longitude at the time of the survey. A
    concurrent survey undertaken in regions west of 173 degrees W by Soviet scientists
    resulted in an estimate of 130,000 to 150,000, suggesting a total estimate of 270,000
    to 290,000 Pacific walruses in 1980.",nt"license_title": "License Not Specified",nt"extras":
